import React from 'react'
import { Link } from 'react-router-dom'

const title = "Most Popular Post"
const postList =
    [ 
    { id:1, imgUrl: process.env.PUBLIC_URL +  '/src/assets/images/blog/10.jpg', imgAlt: 'rajibraj91', title: 'Poor People Campaign Our Resources', date: 'Jun 05,2022', },
    { id:2, imgUrl: process.env.PUBLIC_URL + '/src/assets/images/blog/11.jpg', imgAlt: 'rajibraj91', title: 'Poor Peoples Campaign Our Resources', date: 'Jun 05,2022', },
    { id:3, imgUrl: process.env.PUBLIC_URL + '/src/assets/images/blog/12.jpg', imgAlt: 'rajibraj91', title: 'Poor Peoples Campaign Our Resources', date: 'Jun 05,2022', },
    { id:4, imgUrl: process.env.PUBLIC_URL + '/src/assets/images/blog/09.jpg', imgAlt: 'rajibraj91', title: 'Poor Peoples Campaign Our Resources', date: 'Jun 05,2022', },
    ]

const PopularPost = () => {
  return (
    <div className='widget widget-post'>
        <div className='widget-header'>
        <h5 className='title'>{title}</h5>
        </div>
        <ul className='widget-wrapper'>
            {
            postList.map((blog, i) => (
                <li key={i}>
                    <div className='post-thumb'>
                    <Link to={`/blog/${blog.id}`}>
                    <img src={require(blog.imgUrl)} alt='' />
                        </Link>
                    </div>
                </li>
            ))
        }
        </ul>
    </div>
  )
}

export default PopularPost;
